// Inbox.jsx
import React from 'react';
import Navbar from '../components/navbar';
import DataTable from './data';

const Inbox = () => {
  // Logika untuk mendapatkan dan menampilkan daftar email masuk
  const jsonData = [
    {
      timestamp: '2023-01-01 12:00:00',
      senderEmail: 'sender@example.com',
      subject: 'Permohonan Cuti',
      body: 'Email body goes here...jijorjforjgoi\n\n rjgkfdjgoijgrodjfgkgjirdjgoijgkfjgidjggjxkgjdirjodjxjgoidrjgdjgoirdjg',
      attachment: 'url/to/attachment.pdf',
      attachmentName: 'attachment.pdf',
    },

    {
      timestamp: '2023-01-01 12:00:00',
      senderEmail: 'sender@example.com',
      subject: 'Email Subject',
      body: 'Email body goes here...',
      attachment: 'url/to/attachment.pdf',
      attachmentName: 'attachment.pdf',
    },
  ];

  return (
    <div>
      <Navbar />
      <h2>Inbox</h2>
      <DataTable data={jsonData} />
    </div>
  );
};

export default Inbox;
